import { useState } from 'react';
import {
  Text,
  TouchableOpacity,
  View,
  FlatList,
  TextInput,
  Modal,
} from 'react-native';
import { NativeWindStyleSheet } from 'nativewind';
import { useAtom, atom } from 'jotai';
import useCityFruits from './src/hooks/useCityFruits';

const fromCityAtom = atom('');
const toCityAtom = atom('');
const fruitAtom = atom('');
const quantityAtom = atom(0);

export default function TransferFruits() {
  const { cities, fruits } = useCityFruits();
  const [fromCity] = useAtom(fromCityAtom);
  const [toCity] = useAtom(toCityAtom);
  const [fruit] = useAtom(fruitAtom);
  const [quantity, setQuantity] = useAtom(quantityAtom);

  const [modalVisible, setModalVisible] = useState(false);

  const transferFruit = async () => {
    try {
      console.log({ fromCity, toCity, fruit, quantity });
      const axios = require('axios');
      const res = await axios.post(
        'http://localhost:3000/city_fruits/transfer',
        {
          cityA: fromCity,
          cityB: toCity,
          fruit,
          quantity,
        }
      );
      console.log(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <Modal
      animationType="slide"
      transparent={true}
      visible={modalVisible}
      onRequestClose={() => {
        Alert.alert('Modal has been closed.');
        setModalVisible(!modalVisible);
      }}
    >
      <View className="flex flex-col justify-center items-center">
        <Text className="text-lg font-bold text-gray-700">Transfer</Text>
        <View className="pt-10">
          <Transfer label="From" data={cities} />
        </View>
        <View className="pt-10">
          <Transfer label="To" data={cities} />
        </View>
        <View className="pt-10">
          <Transfer label="Fruit" data={fruits} />
        </View>
        <View className="pt-10">
          <TextInput
            className="border-2 border-gray-300 bg-white h-10 px-5 pr-16 rounded-lg text-sm"
            placeholder="Amount"
            onChangeText={(text) => setQuantity(Number(text))}
          />
        </View>
        <View className="pt-10 w-6/12">
          <TouchableOpacity
            onPress={() => {
              transferFruit();
            }}
            className="bg-blue-500 py-2 px-4 rounded-lg w-full shadow-lg"
          >
            <Text className="text-white text-center">Transfer</Text>
          </TouchableOpacity>
        </View>
      </View>
    </Modal>
  );
}

function Transfer({ label, data }) {
  const [selected, setSelected] = useState('Select ');
  const [open, setOpen] = useState(false);

  const [, setFromCity] = useAtom(fromCityAtom);
  const [, setToCity] = useAtom(toCityAtom);
  const [, setFruit] = useAtom(fruitAtom);

  function handleSelect(value) {
    if (label === 'From') {
      setFromCity(value);
    } else if (label === 'To') {
      setToCity(value);
    } else {
      setFruit(value);
    }
    setSelected(value);
    setOpen(false);
  }

  return (
    <View className="bg-white items-center justify-center">
      <Text className="text-md text-gray-700 font-semibold">{label}</Text>
      <View className="w-72">
        <View className="mt-1">
          <TouchableOpacity
            onPress={() => setOpen(!open)}
            className="relative w-full rounded-lg bg-white py-2 pl-3 pr-10 text-left shadow-md text-l"
          >
            <View className="flex flex-row justify-between">
              <Text> {selected ? selected : ''} </Text>
            </View>
          </TouchableOpacity>
          {open && (
            <FlatList
              className="mt-1 w-full rounded-md bg-white py-1 shadow-lg"
              data={data}
              renderItem={({ item, index }) => (
                <TouchableOpacity
                  key={index}
                  onPress={() => {
                    handleSelect(item);
                  }}
                >
                  <Text
                    className={`block truncate py-2 pl-10 pr-4 ${
                      selected === item
                        ? 'font-medium text-amber-900 bg-amber-100'
                        : 'font-normal text-gray-900'
                    }`}
                  >
                    {data ? item : ''}
                  </Text>
                </TouchableOpacity>
              )}
            />
          )}
        </View>
      </View>
    </View>
  );
}

NativeWindStyleSheet.setOutput({
  default: 'native',
});
